import React from "react";
import FileUpload from "./FileUpload"
import { createClient } from "@supabase/supabase-js";
import { Auth } from "@supabase/auth-ui-react";
import { useNavigate } from "react-router-dom";
import Catalog from './Product/Catalog'


export default function Navbar({ onFileParsed })
{   
    const supabase = createClient(
        "https://fkkbobhpegfhfsvbhcid.supabase.co",
        "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6ImZra2JvYmhwZWdmaGZzdmJoY2lkIiwicm9sZSI6ImFub24iLCJpYXQiOjE3MTgzNjAzOTAsImV4cCI6MjAzMzkzNjM5MH0.0g1YrLe4lF9HJUKHEuh5_toW_5f_k2C2g7dEMrpU3dQsecret api: eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9."
    );

    const navigate = useNavigate();


    async function signOutUser(){
        const {error} = await supabase.auth.signOut();
        navigate("/");
    }

    return(
        <navbar className="mynav">
        <h1 >VIBE</h1>
        <input type="text" placeholder="Search" className="mysearch"></input>
        <button className="search-btn">
        <svg class="svg-icon search-icon" aria-labelledby="title desc" role="img" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 19.9 19.7"><title id="title"></title><desc id="desc"></desc><g class="search-path" fill="none" stroke="#848F91"><path stroke-linecap="square" d="M18.5 18.3l-5.4-5.4"/><circle cx="8" cy="8" r="7"/></g></svg>
        </button>
        <ul className="mynav-list">
            <li><FileUpload onFileParsed={onFileParsed}/> </li>
            <li>Catalog</li>
            <li>Analytics</li>
            <li>Contact Us</li>
            <li><button onClick={()=> signOutUser()}>Sign Out</button></li>
            <li>Dashboard</li>
            <li>My Brand</li>
            
            
            <li></li>
        </ul>
        </navbar>
    )
}
